          "id": "207471a9f8fb072d601f308d0c25e8e915fa4ea0",
          "message": "skip test coverage if tests were not run (#63)\n\n# SUMMARY:\r\nA recent nightly run failed because automated tests did not execute.\r\n(https://github.com/neuralmagic/nm-vllm-ent/actions/runs/10500265493/job/29088756696)\r\nThis caused a follow-on error when the test coverage was supposed to be\r\nreported. To avoid the confusion of the additional error, this code\r\nchange conditionally summarizes the code coverage only if there was a\r\nvalid TEST_STATUS.\r\n\r\n# TEST PLAN:\r\nThe [nm-remote-push\r\njob](https://github.com/neuralmagic/nm-vllm-ent/actions/runs/10514817969/job/29134295227#step:18:31)\r\nconveniently has a TEST failure that demonstrates the success of this\r\ncode change. [The\r\nsummary](https://github.com/neuralmagic/nm-vllm-ent/actions/runs/10514817969)\r\nshows the code coverage report for successful TEST jobs, and does not\r\nshow one for the TEST job that didn’t run the tests.\r\n\r\n<img width=\"937\" alt=\"Screenshot 2024-08-23 at 7 31 36 AM\"\r\nsrc=\"https://github.com/user-attachments/assets/31074723-1f4e-45cd-81a0-bf363834b09d\">\r\n<img width=\"953\" alt=\"Screenshot 2024-08-23 at 7 31 03 AM\"\r\nsrc=\"https://github.com/user-attachments/assets/d7b1f622-66dc-48ea-9fc4-fa8afb765bba\">",
